import React from 'react'
import * as d3 from 'd3'




class Globe extends React.Component{
    constructor(props){
        super(props)
    }

    sty = {
        backgroundColor: 'green'
    }

    render(){
        return(
            <div style={this.sty}>

            </div>
        )
    }


}

export default Globe
